const API_KEY="l9Cz0hTP4SOj2VmIe9uVGCDR1U82"
export const getMatches = () => {
    const url=`https://cricapi.com/api/matches/?apikey=${API_KEY}`;
    return fetch(url)
    .then((response) => response.json())
    .catch((error)=>console.log("ERROR:error"));
};
